}
/*
onClick後 會去後端拉資料 顯示在前端
*/
/*
next : json Server資料 放在表單
*/ 
const List = ({data})=>{
    
    
    /*
    const users = [
        {name:"Pedro",age:21},
        {name:"Hope",age:23}
    ]
    */
    console.log(data)
    
    return <div className="list">
        {data &&  data.map((item)=>{
            return(
                <div>{item.Nation}</div>
            )
        })}
    </div>     
}

export default List;
